        // ì¸ì„¼í‹°ë¸Œ ê°’ì„ ì•ˆì „í•˜ê²Œ íŒŒì‹±í•˜ëŠ” í—¬í¼ í•¨ìˆ˜
        function parseIncentive(value) {
            if (!value) return 0;
            // ë¬¸ìì—´ í˜•íƒœì˜ ê°’ ì²˜ë¦¬
            const strValue = String(value).trim();
            // ì‰¼í‘œ ì œê±° í›„ íŒŒì‹±
            const parsed = parseInt(strValue.replace(/,/g, ''), 10);
            return isNaN(parsed) ? 0 : parsed;
        }

